import React from 'react';

const Dashboard = () => {
  const heartRate = 120; // Exemple de données simulées
  const temperature = 36.5; // Exemple de données simulées

  return (
    <div className="Dashboard">
      <h2>Données Vitales</h2>
      <p>Battements cardiaques : {heartRate} BPM</p>
      <p>Température corporelle : {temperature} °C</p>
    </div>
  );
};

export default Dashboard;
